DROP TABLE IF EXISTS "SOF_STAT";
CREATE TABLE SOF_STAT(PK_STAT_ID INTEGER PRIMARY KEY AUTOINCREMENT, STAT_NUMBER INTEGER NOT NULL, STAT_NAME TEXT NOT NULL, STAT_LATITUDE TEXT NOT NULL, STAT_LONGITUDE TEXT NOT NULL, STAT_TYPE TEXT NOT NULL);
DROP TABLE IF EXISTS "SOF_VEHI";
CREATE TABLE SOF_VEHI(PK_VEHI_ID INTEGER PRIMARY KEY AUTOINCREMENT, VEHI_NUMBER TEXT NOT NULL, VEHI_TYPE TEXT NOT NULL, VEHI_DIRECTION TEXT NOT NULL);
DROP TABLE IF EXISTS "SOF_VEST";
CREATE TABLE SOF_VEST(PK_VEST_ID INTEGER PRIMARY KEY AUTOINCREMENT, FK_VEST_VEHI_ID INTEGER NOT NULL, FK_VEST_STAT_ID INTEGER NOT NULL, VEST_DIRECTION INTEGER NOT NULL);